import { SafeAreaView, Text, ImageBackground, View } from 'react-native';
import welcome from '../assets/images/welcome.jpeg';


export default function Welcomer() {
  return (
    <SafeAreaView>
      <ImageBackground source={welcome} />
        <Text>Hi</Text>
    </SafeAreaView>
  );
}
